import React, { useState } from 'react'
import styled from 'styled-components'

const Check = styled.image`
  width: 24px;
  height: 24px;
`
interface MemberBoxProps {
  clickedAccountList: Array<string>
  account_id: string
  birth_date: string
  gender: string
  name: string
  phone_number: string
}

export const MemberBox = (props: MemberBoxProps) => {
  const {
    clickedAccountList,
    account_id,
    birth_date,
    gender,
    name,
    phone_number,
  } = props
  const [clicked, setClicked] = useState(true)

  return (
    <div
      style={{
        background: clicked ? '#F0F1F3' : '#ffffff',
        display: 'flex',
        width: '100%',
        marginTop: '8px',
        height: '56px',
        alignItems: 'center',
      }}
    >
      <Check>
        <img
          src={clicked ? '/source/icon/check.svg' : '/source/icon/no_check.svg'}
          alt=""
        />
      </Check>
      {account_id}, {birth_date}, {gender}, {name}, {phone_number}
    </div>
  )
}
